import React from "react";

function AdminDashboard() {
    return (
        <div style={styles.page}>
            <h1>Bienvenue sur votre tableau de bord Admin</h1>
            <p>Gérez les utilisateurs et les alertes du système.</p>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
};

export default AdminDashboard;
